CREATE TABLE store (
    list INT,
    list_conversion INT,
    list_county INT,
    list_date_super VARCHAR(30) CHARACTER SET utf8,
    list_latitude NUMERIC(8, 6),
    list_longitude NUMERIC(9, 6),
    list_opendate VARCHAR(30) CHARACTER SET utf8,
    list_st INT,
    list_storenum INT,
    list_strcity VARCHAR(23) CHARACTER SET utf8,
    list_streetaddr VARCHAR(30) CHARACTER SET utf8,
    list_strstate VARCHAR(2) CHARACTER SET utf8,
    list_type_store VARCHAR(11) CHARACTER SET utf8,
    list_zipcode INT
);

